    false,nt"url": null,nt"notes": " n        A2F Consulting was contracted
    by MCC to assess the evaluability of the Georgia Regional Development Fund (GRDF),
    which was established under the Enterprise Development Project component of MCC's
    Georgia Compact I. GRDF was one of the initiatives under the first Georgia Compact,
    which aimed to develop infrastructure and improve the business environment in the
    regions outside of Tbilisi in order to improve the livelihoods of the economically
    disadvantaged. From a conceptual perspective, the proposed Performance Evaluation
    will analyze GRDF's two areas of intervention (financing and technical assistance)
    around three dimensions. The goal of the performance evaluation is to understand
    the validity of the program logic and its assumptions (Design), the degree to which
    the institutional setup affected change (Institutional Framework), and the outcome
    results and lessons learnt (Outcomes). This evaluation approach will be embedded
    in a standard due diligence process for private equity funds. The evaluation will
    utilize document reviews, advanced financial analysis, semi-structured interviews,
    and case studies to assess the three dimensions of the project, their contribution
    to performance of GRDF, and draw concrete conclusions on lessons learned.n      ",nt"license_title":
